import logoKasa from '../Assets/LOGO.png'

function Header(){
    return(
        <div className="header">
            <img src={logoKasa} alt="logo kasa" className="kasa-logo" />
            <nav className="menu">
                <a href='#'>Accueil</a>
                <a href='#'>A propos</a>
            </nav>
        </div>
    )
}
export default Header
